SQL:
  - sql: |
      SELECT     count(1) FROM     sg_b_storage AS a     INNER JOIN pre_r3_base.cp_c_store AS b ON (a.cp_c_store_id = b.id) GROUP BY     b.sg_c_share_store_id,     a.ps_c_sku_id
    plan: |
      project(count(1)="count(1)")
        hashagg(group="ps_c_sku_id,sg_c_share_store_id", count(1)="count()")
          hashjoin(condition="cp_c_store_id = id", type="inner")
            exchange(distribution=hash[1]48, collation=[])
              osstablescan(tables="sg_b_storage[p1,p2,p3,...p48]", shardcount=48, sql="select `cp_c_store_id`, `ps_c_sku_id` from `sg_b_storage` as `sg_b_storage`")
            exchange(distribution=broadcast, collation=[])
              osstablescan(tables="cp_c_store[p1,p2,p3,...p48]", shardcount=48, sql="select `id`, `sg_c_share_store_id` from `cp_c_store` as `cp_c_store`")

